import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import PageAccueil from "./pages/page_d'accueil";
import PageDetails from "./pages/page_detaills";

function App() {
  return (
    <Router>
      <div>
        <h1>Test React: Gérer les équipements</h1>
        <div>
          <Route exact path="/" component={PageAccueil} />
          <Route path="/details/:id" component={PageDetails} />
        </div>
      </div>
    </Router>
  );
}

export default App;
